import React, { useState, useEffect } from "react";
import axios from "axios";
import jwt_decode from "jwt-decode";
import { useNavigate, Link } from "react-router-dom";

const Dashboard = () => {
  const [name, setName] = useState("");
  const [msg, setMsg] = useState("");
  const [token, setToken] = useState("");
  const [expire, setExpire] = useState("");
  const [portofolio, setPortofolio] = useState([]);
  const Navigate = useNavigate();

  useEffect(() => {
    refreshToken();
    getPortofolio();
  }, []);

  const refreshToken = async () => {
    try {
      const response = await axios.get("http://localhost:5000/token");
      setToken(response.data.accessToken);
      const decoded = jwt_decode(response.data.accessToken);
      setName(decoded.name);
      setExpire(decoded.exp);
    } catch (error) {
      if (error.response) {
        Navigate("/");
      }
    }
  };

  const axiosJWT = axios.create();

  axiosJWT.interceptors.request.use(
    async (config) => {
      const currentDate = new Date();
      if (expire * 1000 < currentDate.getTime()) {
        const response = await axios.get("http://localhost:5000/token");

        config.headers.Authorization = `Bearer ${response.data.accessToken}`;

        setToken(response.data.accessToken);

        const decoded = jwt_decode(response.data.accessToken);
        setName(decoded.name);
        setExpire(decoded.exp);
      }
      return config;
    },
    (error) => {
      return Promise.reject(error);
    }
  );

  const getPortofolio = async () => {
    const response = await axiosJWT.get("http://localhost:5000/portofolio");
    setPortofolio(response.data);
  };

  const Delete = async (id) => {
    try {
      const response = await axios.delete(
        `http://localhost:5000/delete/users/${id}`
      );
      setMsg(response.data.msg);
      getUsers();
    } catch (error) {
      if (error.response) {
        setErrorMsg(error.response.data.msg);
      }
    }
  };

  return (
    <div className="container mt-5">
      {msg && (
        <div class="notification is-success" onChange={msg}>
          <strong className="is-centered">{msg}</strong>
        </div>
      )}
      {msgError && (
        <div class="notification is-danger" onChange={msgError}>
          <strong className="is-centered">{msgError}</strong>
        </div>
      )}

      <h1 className="has-text-centered">Selamat Datang : {name}</h1>

      <table className="table is-striped is-fullwidth">
        <thead>
          <tr>
            <th>No</th>
            <th>Judul</th>
            <th>Alamat</th>
            <th>Keterangan</th>
            <th>Gambar</th>
            <th>Action</th>
          </tr>
        </thead>
        <tbody>
          {portofolio.map((porto, index) => (
            <div className="card">
              <header className="card-header">
                <p className="card-header-title">
                  Component    </p>
                <a href="#" className="card-header-icon" aria-label="more options">
                  <span className="icon">
                    <i className="fas fa-angle-down" aria-hidden="true"></i>
                  </span>
                </a>
              </header>
              <div className="card-content">
                <div className="content">
                  Lorem ipsum dolor sit amet, consectetur adipiscing elit. Phasellus nec iaculis mauris.      <a href="#">@bulmaio</a>. <a href="#">#css</a> <a href="#">#responsive</a>
                  <br/>
                  <time datetime="2016-1-1">11:09 PM - 1 Jan 2016</time>
                </div>
              </div>
              <footer className="card-footer">
                <a href="#" className="card-footer-item">Save</a>
                <a href="#" className="card-footer-item">Edit</a>
                <a href="#" className="card-footer-item">Delete</a>
              </footer>
            </div>

          ))}
        </tbody>
      </table>
    </div>
  );
};

export default Dashboard;
